            }
        });
        res.json({
            data: servicio
        });
    } catch (error) {
        console.log(error);
    }
};

export async function deleteServicio_extra(req, res) {
    const { servicio_extra_id } = req.params;
    const deleteRowCount = await Servicio.destroy({
        where: {
            servicio_extra_id
        }
    });
    res.json({
        message: 'Servicio_extra eliminado satisfactoriamente'
    })
}

